// DSPromoCard Component
// ---------------------------------------------

import React, { Component } from 'react';

// components
import { ProductCard } from 'components';

// data dummy
import backgroundImage from 'assets/images/dummy/product-card.jpg';

class DSProductCard extends Component {

  render() {
    const {
      state: { loadFinish }
    } = this;

    return (
      <ProductCard
        title='Membeli Rumah'
        backgroundImage={backgroundImage}
      />
    );
  }
}

export default DSProductCard;
